const Form = () => {
	return (
		<form>
			<label htmlFor='name'>
				Wpisz tutaj swoje imie
				<input type='text' id='name' />
			</label>
			<label htmlFor='email'>
				Wpisz tutaj swój email
				<input type='text' id='email' />
			</label>
			<label htmlFor='password'>
				Wpisz tutaj swoje hasło
				<input type='text' id='password' />
			</label>
		</form>
	);
};

export default Form;
